आरोग्य शिबिराला उत्स्फूर्त प्रतिसाद दिल्याबद्दल लोहेगाव व धानोरीवासीयांचे आभार🙏🏻🙏🏻🙏🏻🙏🏻

मी मा.श्री.मंगेश चिवटे ( Mangesh Chivate) (ओएसडी वैदकिया कक्ष), डॉ.सौ.श्रद्धा (गायनॅक तज्ञ), डॉ.कविता कांबळे (गायनॅक तज्ञ), डॉ. श्री .भूषण बालघाट (कर्करोग तज्ञ )सौ.पूजा रावेतकर (महिला शहर प्रमुख),मा.श्री. सुनील जाधव (उपशहरप्रमुख), श्री. सुहास कांबळे (प्रभाग प्रमुख येरवडा) श्री.सचिन चव्हाण (प्रभाग प्रमुख वाघोली) यांचे आभार मानू इच्छिते. तसेच सूर्य सह्याद्री रूग्णालयाचे संघ आणि अप्रतिम जीवनशैली मार्गदर्शनासाठी आरोग्य प्रशिक्षक सौ. Sneha Pawar यांचे देखील आभार मानू इच्छिते….

त्याचप्रमाणे शिबिराला उपस्थीत राहूण उपक्रमाची शोभा वडवळ्यबदल मी मा.श्री रामभाऊ मोझे (मा. आमदार ),मा.श्री अशोक (बापू) खांदवे (राष्ट्रवादी काँग्रेस), मा.श्री सुनील खांदवे (भाजप) आणि मा.श्री गणेश खांदवे यांचे देखिल आभार मानू इच्छिते…

जय हिंद, जय महाराष्ट्र 🙏🏻🙏🏻🙏🏻🙏🏻

